import react, { useState } from "react";
function Card(props){
    return (
    <div class="card" id={`card-${props.id}`} style="width: 18rem;" >

      <div class="card-body">
        <h5 class="card-title">{props.title}</h5>
        <p class="card-text">{props.desc}</p>
        <a href={`/page?itemid=${props.id}`} class="btn btn-primary">{props.price}</a>
      </div>
    </div>
    )
}
export default Card;
